(1, 1, '17 February 1975', '16 July', 'Our Lady of Mt. Carmel', 'Cubao', '<p style=\"text-align: justify\">The Quezon City district of New Manila is a haven for various Catholic orders, with many chapels and convents scattered around the area; from the American colonial period (1898-1946) Convent of Carmel of Thérèse of Lisieux, the Sisters of St. Paul of Chartres Novitiate and Provincial House (established 1931), Franciscan St. Joseph’s Academy and Convent (established 1932), and the Society of the Divine Word’s Christ the King Mission Seminary (established 1933), to the post-war Congregation of the Religious of the Virgin Mary Compound (established 1950), the Pink Sister’s St. Joseph Convent of Perpetual Adoration (established 1965), the Congregatio Immaculati Cordis Mariae’s Maryhill School Of The Theology (1979),the Local Superior of The Society of Monfort Missionaries(established 1984), and the Foundation for Carmelite Scholastics(established 1987). However, the center of most Catholic activities is the Minor Basilica of the National Shrine of Our Lady of Mount Carmel, located on Broadway Avenue, taking most of the block between 4th and 5th street.</p><p>\r\n</p><p style=\"text-align: justify\">The Mount Carmel Parish is part of the third wave of Discalced Carmelites missions to the Philippines, which started in 1923, with the arrival of four French nuns from Hue, Vietnam, to the shores of Jaro, Iloilo. In this first wave, the Convent Carmel of Thérèse of Lisieux was founded in 1926, along Gilmore Avenue, in New Manila. The second wave also began in Infanta, Quezon Province, in 1946; and this time the Discalced Carmelite friars were now leading the wave. Part of the third wave that started in Jaro, Iloilo, the Anglo-Irish Carmelite friars established a foundation in 1954, in New Manila, Quezon City, and on December 30 of the same year, the cornerstone was laid for the new church.</p><p>\r\n</p><p style=\"text-align: justify\">The new church was dedicated as a shrine to Our Lady of Mount Carmel, a title of the Blessed Virgin Mary, which the first Carmelites named in the construction of their first monastery on Mount Karmel (Har HaKarmel) in the northern territories of Israel, during the 12th Century. The order of Carmelite started with Christian hermits living in Har HaKarmel, during the Crusades, who chose the mountain where the prophet Elijah had lived and challenged the priests of the god Baal, as a reflection of their faith against the Muslims who have taken over the holy city of Jerusalem.</p>', NULL, 1, '2019-06-19 14:27:04', 1, '2019-09-21 19:55:36', b'0'),
(2, 2, '20 April 1969', '', '', '', '<p style=\"text-align: justify\">The Anglo-Irish Carmelites came to the Philippines primarily to work with the Carmelite Nuns and the Secular Order of Carmel. Yet, pastoral needs had not turned deaf ear to the cry “cry of the people”. It was during the 1952 Bishop’s Conference held in Manila that Archbishop Jose Ma. Cuenco of Jaro, Iloilo City, approached the Discalced Carmelites and invited them to his Archdiocese, immediately offering them a church and a convent. It was only in 1953, that the Carmelites actually accepted the invitation and agreed to make a foundation in Jaro itself.</p><p>\r\n</p><p style=\"text-align: justify\">There was no luck in personnel in St. Joseph the Worker Parish. Father John Mary Chin in Jaro as the community’s new bursar. In January 5, 1954, Father Mark informed the Jaro community that the “Magi had arrived!” This good news announced the arrival of Father Vincent Rogers, Father Gregory Maloney and Father Celsus Wren, later reassigned to Ireland. Brother Kieran Deely took his place. Several other Carmelites arrived and were immediately assigned at one time or another in Jaro. There were Father Joseph Glynn, Father John Venard Smith, Father Sean Walsh(later assigned to the Novitiate in Tugbok, Davao City), Father Michael Fritzgerald and Father Frank Considine.</p><p>\r\n</p><p style=\"text-align: justify\">In 1964, the Carmelites were able to build St. Joseph the Worker Church, a simple two-storey wooden structure, which served as a chapel on the first floor and a Monastery on the second floor. In 1969, the little chapel, seating merely 120 persons, was raised to the status of “Parish Church” and officially became the St. Joseph the Worker Parish. The decree of erection on April 20, 1969 states:</p><p>\r\n</p><p style=\"text-align: justify\">“Since the spiritual needs of the people of the Cathedral Parish of Jaro, Iloilo City, cannot be properly attended to because of the large territory of the Parish and because of the distance of some barrios of Mandurriao, Iloilo City and Pavia, Iloilo, from their respective Parish churches, I by the race of God and the Apostolic See, Archbishop of Jaro, After mature consideration and for the sake of the salvation of souls, hereby erect the new Parish of St. Joseph the Worker, in the Barrio of San Isidro, Jaro, Iloilo City.</p><p>\r\n</p><p style=\"text-align: justify\">At the same time, I hereby decree that the new Parish comprises the following barrios of Jaro, namely, SAN ISIDRO, SAMBAG, UNGCA, AND DUNGON: barrios of MANDURRIAO, DUNGON, STA. ROSA, AND TAFT; whose inhabitants will constitute the members of the new Parish St. Joseph the Worker.”</p><p>\r\n</p><p style=\"text-align: justify\">Aside from the barangays, the Parish also ministers to the three public schools in Barangay Dungon B, Sambag and Ungca II. the pupils in Luis Mirasol Memorial Elementary School, Sambag Elementary School, and Ungca II Elementary School were taught catechism in their regular religion classes and were appropriately prepared to receive the Holy Sacraments in the Parish Church. Children are also tap to participate in the parochial activities through membership in the various mandated organizations</p><p>\r\n</p><p style=\"text-align: justify\">Realizing their role in the parish, the people responded to the call in participating in the muti-faceted ministries of the Church. One after another groups were formed and the workload was lighter than before.</p><p>\r\n</p><p style=\"text-align: justify\">After servicing the parish for more than twenty-five years and with the advent of an increasing parish population, the two-storey St. Joseph Parish Church was demolished in the mid 1994 to give way for a bigger and more permanent Church. On May 1, 1994, the groundbreaking ceremony took place with the late Archbishop Alberto Piamonte officiating. The “new” St. Joseph the Worker Parish Church , which seats 1,000 was blessed on October 15, 1995.</p><p>\r\n</p><p style=\"text-align: justify\">Three years, six months and sixteen days have since the “new” St. Joseph Church has been blessed and now it has become more than just a “new building”. It stands as a new “monument” of renewed, faith, hope and life in the entire parish. Over the last thirty years, St. Joseph the Worker has developed into a true parish. One that is a “community of disciples”, a people who strive to live out the priestly, prophetic and kingly mission of Christ, with equal respect and complementing each other’s particular talents. To move from “theory” to “life”, the parish of St. Joseph the Worker organized its Parish Congress in April 12, 1996 with participants coming from every barangay and the mandated organizations in the Parish. \r\n</p><p>\r\n</p><p style=\"text-align: justify\">The result of this was the erection of the Parish Pastoral Council (PPC) which sets off the goals laid out in the parish pastoral plan; Parish Apostolic Council (PAC) is the implementing arm of the Parish and is made of several ministries, such as worship, education, services, temporalities, and youth; and the Parish Finance Council (PFC) whose duty is to find the money to finance the parish projects. Each of theseCouncils has its own norms and by-laws to guide and regulate their way of proceeding in accordance with the needs and aspirations of the “people of God” in St. Joseph the Worker Parish.</p><p>\r\n</p><p style=\"text-align: justify\">The Parish Councils of St. Joseph the Worker Parish are in place. The “hard works” of moving from theory to implementation got off to a good start, THANK GOD! The members of the six ministries which makes up the Parish Apostolic Council, together with the other two Parish Councils are clear on where they are going and very much aware of what their functions are. Their direction is to establish a Church, a people of God who are “Christian, community and united”. This tells us that they intend to establish a Church that “ serves and shares its time, talent and treasures” with everybody, no matter who he or she may be. This Christian sense of evangelical service is evident in all mandated organizations, which functions to establish the parish of St. Joseph the Worker Parish, we can see that they are positive and constructive “outreach” in action, we can see this in the “bond” that exists between the barangay within the parish and the parish leadership. The Carmelites and the parish personnel have offered the parish facilities for various civil activities sponsored by the Barnagay surrounding the parish. It’s also seen in the mentality of parish leaders who have always valued “education”. It is evident that the parish has high esteem for the teachers and administrators of the three Elementary Schools who with great sacrifice have served faithfully and contributed enormously to the growth of St. Joseph the Worker Parish, and especially to the well being of the Nation. The parish has responded by providing religious education projects for three barangay elementary schools throughout the year. The few pastoral and evangelical services offered by the parish priest and the parish catechists are successful because of the cooperation and collaboration of the teachers and their administrators in those three barangay elementary schools within the parish. The parish benefit greatly for this simple attitude and spirit and it is most grateful.</p><p>\r\n</p><p style=\"text-align: justify\">Over and over this accomplishments and success, the parish of St. Joseph the Worker is most grateful and forever be indebted to the different parish priests who have willfully offered their talents and full service for the betterment of this humble place in Jaro, Iloilo City. in its thirtieth year, the parish has found new “ kura paroko” in the person of Father Danilo D. Fauste, OCD, who has installed last March 19, 1999, taking over Father Arnold Boehme, OCD (1996-1999). Father Dan, as he is fondly called by the parishioners, hails from Southern Leyte and is the tenth parish priest who was assigned her at St. Joseph. The other parish priests who have spent some years here in Jaro were: Father Vincent Rogers, OCD (1969-1972), Father John Paul Kelley, OCD (1972-1975), Father Michael Fritzgerald, OCD (1975-1978), Father Anselm Ca ñonero, OCD (1978-1982), Father Herman Esselman, OCD (1982-1985), Father Tom Shanahan, OCD (1985-1987), Father Salvador de la Cruz, OCD (1987-1989), Father Alex T. Collera, OCD (1989-1996), Father Arnold Boehme, OCD (1996-1999).</p>', NULL, 1, '2019-09-16 14:46:01', NULL, NULL, b'0'),
(3, 3, '9 November 1923', '', '', '', '<p style=\"text-align: justify\">Jaro Carmel, the first Discalced Carmelite Monastery in the Philippines was founded from the Carmel of Hue, Vietnam because of the earnest request of Bishop James McCloskey, then Bishop of Jaro, Iloilo City, Philippines.</p><p>\r\n</p><p style=\"text-align: justify\">The Carmel of Lisieux where St. Therese of the Child Jesus entered, founded the Carmel of Saigon, Vietnam in 1861. Saigon Carmel founded the Carmel of Hanoi in 1895, Hanoi Carmel founded the Carmel of Hue in 1909 and Hue Carmel founded the Carmel of Jaro in 1923. St. Therese wrote to her spiritual brother, Fr. Roulland about six months before her death (March 19,1897); \"...I can assure you that if Jesus does not soon come looking for me from the Carmel of Heaven, I shall one day leave for that of Hanoi; for now there is a Carmel in that city, the Saigon Carmel recently founded it.\"\" Her desire to go to Hanoi Carmel was not realized because of her illness. She said: \"After my death I will go very quickly to the Carmel of Hanoi.\"</p><p>\r\n</p><p style=\"text-align: justify\">Most Reverend James P. McCloskey had a great love for and devotion to Our Lady of Mount Carmel and St. Therese of the Child Jesus. Because of this he desired to have a Carmelite Monastery in his diocese. He dreamt that there would be someone who, by day and by night, would be praying for the needs of his diocese; its bishop and priests in particular, and for the Philippines, in general.</p><p>\r\n</p><p style=\"text-align: justify\">The dream became a reality on November 9, 1923. This day marked the foundation of Carmel in the Philippines. The first Mass was celebrated in Molo, Iloilo City, where the four foundresses were temporarily housed.</p><p>\r\n</p><p style=\"text-align: justify\">In the book entitled, St. Therese of Lisieux, the Little Flower, written by Fr. Thomas Taylor, he wrote of an incident that Cardinal Dougherty, then Archbishop of Manila shared with him; \"\"Replying to a further question His Eminence told the story of what had occurred to Bishop McCloskey of the Philippines. The narrative is from the Bishop\'s own lips. Visiting the Carmel of Lisieux he passed through the sacristy where, behind a beautiful wrought-iron screen, are kept the most precious souvenirs of the Saint, such as the long tresses of her hair, her habit and First Communion dress, her instruments of penance, the miraculous palm which was buried with her and which was found to be still fresh and green, thirteen years after her death; as well as other articles of interest. A Carmelite nun standing before the grille explained to him the various objects. It was pleasant to listen to her account, but he went away puzzled at the presence of a Carmelite outside of her enclosure. Later in the day he referred to the matter when speaking to the Prioress, Mother Agnes of Jesus (Pauline; the blood sister of St. Therese). The Prioress assured him that not one of her community left the enclosure that day. The Bishop firmly insisted that he had seen a Carmelite nun in the sacristy.</p><p>\r\n</p><p style=\"text-align: justify\">\"\"Would Your Lordship kindly describe the person you saw?\" said Mother Agnes. The Bishop gave a full description of the nun, \"My Lord,\" she replied, \"the one who did you the honour of explaining the souvenirs in the sacristy was none other than Saint Therese of the Child Jesus herself.\"</p><p>\r\n</p><p style=\"text-align: justify\">Bishop McCloskey was the first member of the Discalced Carmelite Third Order in the Philippines. He donated all his inheritance from the estate of his parents in Philadelphia for the building of Jaro Carmel. He died a saintly death on April 9, 1945. Fourteen years after his death, his brown scapular and his wooden rosary beads were found intact, while his priestly vestments were reduced to dust. These souvenirs are kept in Jaro Carmel.</p><p>\r\n</p><p style=\"text-align: justify\">Source: https://www.jarocarmel.com/</p>\r\n', NULL, 1, '2019-09-16 14:59:23', 1, '2019-09-21 17:52:26', b'0'),
