(5, 5, '15 May 1965', '', '', '', '<p style=\"text-align: justify\">The first Discalced Carmelite Friars in the Philippines arrived in 1947. After ten years, in 1957, they decide to “established a retreat house for the purpose of practice in prayer and spiritual life (Carmelite Constitutio, 55).”</p><p>\r\n</p><p style=\"text-align: justify\">In the mid 50’s Father Gabriel Gates, OCD was asked to set up a retreat house in the Diocese of Bacolod, Negros Occidental. Having received the ecclesial permission, the cornerstone of Our Lady’s Hill Retreat House was laid on May 15, 1965. On July 17, 1966, the Retreat House was inaugurated and blessed by Bishop Manuel Yap, Bishop Ordinary of Bacolod City. the Director of the Center for 20 years was Fr. Bernard Ybiernas-Mapa, OCD.</p><p>\r\n</p><p style=\"text-align: justify\">Over the years, Our Lady’s Hill became known as a place of prayer and silence. Its solitude has been helping retreatants discover the mystical space at the center of their lives. They found nourishment to satisfy their hunger and thirst for God.</p><p>\r\n</p><p style=\"text-align: justify\">Due to social-political situation, the Retreat House was closed in the late 80’s anre-opened in early 90’s. From 2001-2006 it was renamed as the Postulants’ House of Formation due to the increase of vocation.</p><p>\r\n</p><p style=\"text-align: justify\">The Provincial Chapter of OCD in March 2005 decided to establish the Center of Spirituality, entirely directed to prayer and contemplation at the service of the Church. For the past 40 years, Our Lady’s Hill never lost its spirit of prayer, silence and solitude.</p>', NULL, 1, '2019-09-16 15:02:09', NULL, NULL, b'0'),
