(10, 10, '', '', '', '', '<p style=\"text-align: justify\"> Like a bud of a flower on an arid ground of summer is the birth of Ozamis Carmel. In the midst of seeming impossibility, God in all his goodness showed Himself a LIVING GOD, since this Carmel is the Carmel of the living GOD. He made all things possible in the emptiness and nothingness of the place and people. The scenario revealed the nada, nada of St. John of the Cross since he is the patron saint of this new community.</p><p>\r\n</p><p style=\"text-align: justify\">When Bishop Patrick Cronin SSC (realizing the value of the presence of contemplative community devoted to prayer as a dynamo of the Church in his area of responsibility) invited the Carmel of Bacolod to have foundation in his prelature in 1950, Bacolod Carmel was only 4 years old, newly devastated by the recent war and surely not yet ready for a foundation. At that moment, Mother Mary Louise requested Rev. Fr. Marie- Eugene, then first Definitor of our order, to choose two Carmelites to strengthen her own Carmel of Bacolod in view of the future foundation. In May 1954, two French nuns arrived in the Philippines, Sister Catherine Teresa Trits and Sister Frances Therese Delmas, to become chapter nuns of Bacolod Carmel. It was only in 1961 that Mother Mary Louise judged that her community was ready for a foundation of which she was the moving Spirit.</p><p>\r\n</p><p style=\"text-align: justify\">It was in August 1962 that Bishop Cronin gave the signal to start the foundation. However, despite his fervent desire, he was not in a financial condition to help build Carmel. He wrote to Mo. Frances, “My prelature is poor and my income is small.” When Mo. Mary Louise received this news, she consulted her community and the generous friends and benefactors of Bacolod Carmel. Mr and Mrs. Edgardo Ledesma, Sr., Mr and Mrs. Fernando Arguelles, Sr. donated the amount for the acquisition of the land. The land chosen was partly from the properties of Dr. Jesus Sanciangco Sr., and Mr. Cenon Carcueva and also Ana Fernandez. It was on March 14, 1962 that Mother Frances Therese of the Child Jesus and Sr. Mary Therese of the Sacred Heart And Sr. Marie Madeleine of the Redemption left Bacolod for Ozamis to have a look and to choose the place where Carmel be built. They had chosen this place because the scenery is beautiful it is on top of a hill overlooking the sea and the panoramic view of the mountains across the sea is really marvelous.</p><p>\r\n</p><p style=\"text-align: justify\">In August 1962 (4th centenary of the foundation of St. Joseph of Avila), Mo. Frances Therese with Sr. Marie Stella with two extern sisters, Sr. Marie Pia and Sr. Josefa left for Ozamis. They had only Php300 cash with one maleta for the needs of the sacristy and another with some cloth to be sown for religious habit. Since the airplane cannot take off because of the storm, they had to take the boat from Cebu and God in His providence had given them IndaySoling Lomanta. They bonded with one another instantly. Upon arriving in Ozamis the Columban sisters offered them shelter but later on they decided to stay in Malaubang and their acquaintance with Inday Soling Lomanta gave them enough courage to ask their bungalow house to be lent to them while the construction was going on which she and her husband ArceLomanta agreed wholeheartedly. During their stay for 3 months they didn’t have sufficient water. Felipe and Anie Tio (young lad then) fetched water for their needs. Bishop Cronin being active member of the Council in Rome, delegated Fr. Micheal Breen, Fr. Robert Stack and Fr. Patrick Crowe to help them in their difficulties they would be encountering in the foundations. On first day Mayor Hilarion Ramiro, Sr. sent them a guard for the night. But thanking him, they said they did not need guard since people had adopted them. What they were not aware of was that Malaubang was a haven for criminals and outlaws where many bad incidents occur at night. Also the vicinity was full of Aglipayans and Monkadistas. The latter warned the people not to harm them for God is with them which is the reason why they were not afraid. </p><p>\r\n</p><p style=\"text-align: justify\">With the help of the people of Bacolod who promised to support them and they also made a loan of Php 15,000.00. They were able to build the Monastery made of Nipa and Bamboo. God in his infinite goodness and mercy cared for them out of the poverty of the people around even students brought eggs, bananas, vegetables, fruits, which some of them just placed by the door without leaving their names. Since they were all strangers in this place, God sent them Salvador Salvador, Elizabeth Tongco and Miss Esperanza Daomilas to help them in their needs. The first gave them service in offering them ride through his kalesa, the second serve them as portress and selling their products in the city riding the kalesa and the third was all around in contacting people who helped were needed badly.\r\n</p><p>\r\n</p><p style=\"text-align: justify\">On October 3, 1962 their acting Superior, Fr. Michael Breen, who came early in the morning to say mass it was surprised that the small receiving room which became their chapel for 3 months became full in less than 15 minutes. It was the feast of St. Therese at that time. It was the mass of thanksgiving since they knew that our Holy Mother St. Teresa considered a foundation made when the first mass was celebrated. It was in this Holy Sacrifice of the Mass that they learned that their humble answer to the call from God and the Bishop of Ozamis was accepted and ratified. Truly at that moment their little monastery was born in the great order of Carmel. By December 27, 1962, Mo. Frances Therese and Sr. Mary Stella transferred to the place of the Monastery. Their Chapel was open to the public.</p><p>\r\n</p><p style=\"text-align: justify\">On February 1963, Sr.Mary Therese arrived as part of the core group of the foundation brought by her parents and her sister, Miss Cecilia C. Arguelles. Sr.Joseph Teresa, professed nun from Cebu Carmel arrived and later Gilmore Carmel sent Sr. Paule Teresa, a novice professed to join the two other extern sisters from Bacolod and Gilmore Carmel and Sr. Mary Helen from Bacolod, a professed nun also came.</p><p>\r\n</p><p style=\"text-align: justify\">Finally on April 28, 1963 the Solemn Inauguration of our Monastery took place. It was also the declaration and closing of the Papal enclosure for nuns. The solemn High Mass was celebrated by Bishop Patrick Cronin with other Columban Priests. Fr. Bernard Ybiernas, OCD preached the homily while the group of late Engr. George Abinales sung the choir. While enclosed in the Monastery the nuns felt all the support of their devoted friends daily remaining with them despite the fact of being hidden in the enclosure. Aside from all these friends from locality, there was one young lad, Antonio Encia that Mother Frances brought along from Bacolod Carmel. He became an errand boy for the young community and until these days still in service. Later on the late Elias Estremadura together with his whole family came and remains in the vicinity until now. Third was the late Luis Escaba who helped a lot in the construction of the buildings of which his children still with us. Thanks to them all.</p><p>\r\n</p><p style=\"text-align: justify\">Until the day of the Inauguration, the needs of the foundation were sufficient with the help of its benefactors, the people of Ozamis and the Columban priests. Being so few and so new in the place, God gifted them with the local vocation. On June 21, 1964, Miss Esperanza N. Daomilas finally entered. Her presence in the community was a real great help. With no capital and meager market the community had to find means to support itself since in the order of Carmel each community is autonomous. So then they ventured in making home made jams and jellies which they sold and later Sr. Lucy Ancilla together with Mrs. Lomanta solicited money so that they can build a native oven for the community to be able to bake and supply simple goodies to school canteens in the city and neighboring towns. They baked cassava, banana cakes and fruit cakes (during Christmas Only – made by Sr.MaryTherese) that were sold by Teddy and Luisa Rebutazo. Then they started cottage industry. Hand made cards made by the nuns with the little mimeographing machine which they sold in the bigger cities like Cebu and Manila. In 1968, they started the weaving industry a cottage industry helped by Ernesto Maceda. They brought some young girls from Iloilo to do the work and the extern sisters did the marketing all over the place including Cebu, Manila, Leyte, Davao and other places. The proceeds help for the sustenance of the growing community and for the improvement of the building. For five years they suffered from insufficient water supply. The fire department with the late Divino Daomilas as its head brought water regularly for their laundry needs. The late Arce Lumanta and sometimes Antonio Encia fetch water for their drinking needs. Finally, with the help of the city government they were able to build an artesian well and the late Andres Rebutazo help them build a concrete water tank. There were lots of people that contributed to help them in their daily life like the Catingub family of Talisay, Mama Campilfrom the city to give them some material for the flooring- tiles. At the end of the 60\'s Sr. Ancilla decided to make reclamation project across the street with the help from the city Engineers office to borrow their machineries to carry stones, soil from inside the enclosure. That parcel of land was sold to individual residence and the proceeds were used for the renovation of the chapel and partly for the interior of the building. In 1970s Sr. Ancilla started to put up fishing with two fishing boats handled by few responsible men. However, it did not last long. The community decided to close down. In 1973, the community decided to start printing business with only Christmas cards with one Minerva machine with one printer. Later on the machine doubled that they got two workers. As the years went by, it grew into commercial printing with more workers and more jobs. However, as the computer becomes very in demand the business competition increased that it could not cope up with the salaries of the workers that eventually led to its closure. \r\n</p><p>\r\n</p><p style=\"text-align: justify\">In 1964, a young instructor from U.P. Diliman Q.C. fell in love with Jesus. She tried to inquire in Gilmore Carmel, New Manila. When she opened her heart to her spiritual director - Fr. James Reuter, S.J. the latter told her... ”If you want to be poor, go to Ozamis Carmel” her aunt also told her to go to Ozamis Carmel as it was a new foundation. Off she went and on January 15, 1965 she arrived in Ozamis with Sr. Mary Benigna of St. Joseph, a novice professed from Gilmore Carmel. This young lady became Sister Marie Yvonne of the living God who became the first Prioress to replace Mo. Frances Therese, the youngest Prioress throughout the Philippines at that time. From then on the meager meals was a bit alleviated and the scarcity of the things needed daily for the growing number of sisters were very much relieved because the sisters had an additional and more places to go to sell their products. They could go to Manila and stayed in the residence of Mr.and Mrs.Edmund Kaimo, cousin of Sr. Mary Stella, and later on with the family of Mother Yvonne whose parents, Dr. and Mrs. Barker Brown, were one among our very first monthly benefactors which was followed by their son Dr. and Mrs. Walter Brown who are still donating regularly until this days. Thanks to them.</p><p>\r\n</p><p style=\"text-align: justify\">Our simple lifestyle attracted many young ladies full of life who freely choose to give up a promising future to follow the call of Jesus, to embrace His life of poverty and complete gift of self and become a Carmelite nun. With the growing number of vocations, soon the place was too small. Again, with the help of some generous benefactors and friends like: the late Mr. and Mrs. Luis Jalandoni, Mrs. Puring Ledesma, Miss Juliet Ledesma, Mr. and Mrs. Ramon de La Rama, Mrs. Consuelo Valderama, Dr. and Mrs. Elias Dacudao gave substantial amount were given by them towards the building of permanent buildings made of cement wood and asbestos roofing, upstairs dormitory, bakery, offices and kitchen downstairs.</p><p>\r\n</p><p style=\"text-align: justify\">The whole miniature monastery was enclosed only with bamboo slits and its height was too short. Later on, with the help of some generous friends from the city and other places they were able to buy empty asphalt drums to replace the bamboo slits. This went on only for 15 years. In 1975, Sister L. Ancilla worked hard to replace these walls to cement walls, as maintaining that temporary wall was expensive. They have to replace the posts often and intruders can easily enter at night to steal the fruits, vegetables, piglets and other produce. Some close friends noticed their miserable and dilapidated walls and the dangers they were exposed to, so they started a fund drive during the Christmas season. The Sisters appealed to friends both local and abroad. They received regularly donation from Miss. Fe Legaspi who is residing in U.S. and from another couple who wanted to remain anonymous. They also received a big help from Iligan City through Engr. Bernabe Yañez who was the manager of Mindanao Portland Cement. Then they appealed to some organizations both local and abroad which Belgium responded and Kolping Munich West Germany too. The Charismatic group through Sister Violeta Navarro also was Cooperative, giving according to their means. Finally, thanks to the favors given by Chuan Seng and Grace Hardware by allowing them to get materials needed payable in God’s own time they were able to finish the walls.</p><p>\r\n</p><p style=\"text-align: justify\">The Carmelites are called “Sister of the Blessed Virgin Mary, their lives like hers is hidden based on prayer, humility and simplicity doing manual work balanced with solitude, study and cheerful recreation and community meetings and all blossoming from the love of God and for His people. Blessed Elizabeth of the Trinity says that “the life of a Carmelite is a perpetual advent that prepares the incarnation of Christ in souls”, the life attuned to the needs of our people, of their local church of their priests, their prayer life is nourished by these intentions. Pere Jacques of Jesus said, “That person who entered Carmel is not to escape from weariness, nor to know tranquility, nor to live a \r\nmediocre life, nor to flee the cares of keeping a home and family, nor to have a more comfortable existence. One comes here because she is athirst for God, because she desires to find God and to reveal to the whole world. We are vowed to prayer; it is the hallmark of our order. We did not come to Carmel to engage in intellectual studies, to have this particular activity. We have come for one single reason: TO PRAY, TO BE SOULS OF PRAYER; that is to say`, SOULS OF LOVE, who spends their lives loving God. All the rest have no importance”. Our dear Archbishop Cronin understood very much our lives as cloistered Carmelites. His eyes and heart were watching over us. He desired so much to help us. Thus his mediation in Rome obtained a hundred thousand pesos donation to pay our debts and a wing was built for the extern sisters, so that the Nipa and bamboo were demolished from their area. In 1972, Archbishop Cronin was transferred to Cagayan De Oro. He left us the savings he had at hand. He was replaced by Bishop Jesus Varela whom we received with love and remained our superior and father for10 yrs. Our financial situation remained the same until 1977 when the Apostolic Nuncio Monsignor Bruno Torpigliani came and visited us. He saw the poor building of bamboo and Nipa, sheltering a vibrant community and he understood the necessity of a permanent building. He saw that their support could only help partially. He suggested making an appeal to Rome and to Germany, an appeal that he himself followed up with his own recommendation and that of our own Bishop. After nearly 20 years of hoping and praying and apparent “silence” the good God answered our prayers. We received generous donations. In 1982, we could offer the public a larger and descent chapel and some months later the monastery was completed. It was by this time that the community accepted the meeting of the whole Federation of Carmel in the Philippines. \r\n</p><p>\r\n</p><p style=\"text-align: justify\">The extern sisters had transferred to their living quarters downstairs. Their former place in the attic became a little place for priest, seminarians, and religious and even lay people who needed few days retreat and recollection. Those who desired to be one with the Lord in silence and solitude were accommodated. They have their own oratory and little kitchen, bathroom and comfort room. As the number of retreatants increased we cannot accommodate them as there are only 8 rooms. The idea of a real retreat house with conference room dawned in the heart and mind of Mother Frances Therese as well as the DOPIM Bishops , our priest and our people. The late bishop Ben Tudtud wished that it will be in the sea with stones formed DOPIM. We found it unaffordable so Mother Frances Therese visualized it on the land small building in Nipa or Cogon. This dream kept coming back and we prayed and waited for God’s sign. That if God willed it, He would let us know. The sign came, it was a gift from a dear Sister Maria NapolitaAng (angging in short) a Carmelite by desire. After her return to God her mother (the late Mama Titang) and family were inspired to donate to Carmel all that belongs to her. Thus it was the beginning to finance the retreat house of which the date of the blessings of the cornerstone was set on October 15, 1987, the feast day of our Holy Mother St. Teresa and also the birthday of Angging. What a better memorial we could offer for her. As the construction started the demand for retreats and seminars were growing. More people came for booking from different schools from neighboring towns and cities and even business establishment like the Iligan National Steel Corporation came to book. Soon the place was not enough. The idea to build an additional building like a dormitory that can accommodate 80 to 120 people as well as a bigger chapel and bigger dining hall came to our minds. Then we realized that funds were not enough. Even with the fundraising and donations from German Catholic Bishops Conference (another sign of God’s approval) it was still a long way to go. Then, on our Silver Jubilee on Oct. 03, 1987, Sr. Lucy Ancilla with the spirit of faith and determination thought to include this project by organizing committees (composed of our good friends of Ozamis). They had different raffle draws and the funds raised were intended for the said project. In Nov. 12, 1988, Fr. James Reuter, S.J, came with a group of young people from Manila for fund raising in presenting the drama about Lorenzo Ruiz and the Christianity in the Philippines. The proceeds were given all for the retreat house. In 1989, Sr. Lucy Ancilla went to US for the death of her sister at the same time went around several churches with the consent of our Archbishop to make appeal (during mass) for the retreat house. She also went to Iligan City to negotiate for the color roof roofing and received the donations from our benefactors and many anonymous donors who had made great contributions for the completion of this project. God be praised! As the buildings were ready to accommodate retreatants, it became self sufficient in providing what was still needed to furnish the whole place. In the beginning, Sr. Lucy Ancilla managed the retreat house later on God gave us divine providence in the person of Sister Decdec Brobo to manage on our behalf which she continues to perform until now. She became an OCDS and the current President of Ozamiz chapter. As we celebrate our 50 yrs. We will also celebrate the silver jubilee year of our retreat house.</p><p>\r\n</p><p style=\"text-align: justify\">Meanwhile we also acknowledged the gift of the late Dona Josefa Capistrano, the house and lot near our property in Malaubang. As well as the lot near the retreat house donated by Mrs. Custodia Sanchiangco Parker. We are also grateful to Dr.and Mrs. Walter Brown who had helped us purchased the house and lot in front of our chapel and Victor Consunji who provided money and workers for the completion of the building.</p><p>\r\n</p><p style=\"text-align: justify\">In 1998, we noticed the deterioration of our chapel. The bamboo ceiling by the sanctuary was sagging. The workmen had to support it with wood while the engineer inspected the materials above. Some of the walls were also eaten by the termites. Moved with great love, Mother Frances Therese decided to earn money in order to repair the chapel by her piano skills. This is where her motto came true “TO LOVE HIM SO MUCH UNTIL YOU LOSE EVERYTHING FOR HIM WITH HUMILITY, WITH GENEROSITY IN THE WAY HE HAS CHOSEN UNTIL THE END. Despite of her sickness and weakness, she practiced intently to be able to produce tapes and CDs for sale. It was entitled, “CONCERT at 90”. She labored and given herself till the end for not long after, she got stoke, hospitalized, could not speak, brought to Manila and got complications of Pneumonia. Sr. Mary Liesse made a mission appeal with the permission of the Bishop and at the same time sold the tapes and CD’s. Mother Yvonne and other sisters also sold some in Manila as well as in our city and other cities too. Some friends and families also help. Thus we were about to gather some amount to begin the complete renovation of our chapel. Architect Marie Canezares made the beautiful plan for free and he sent a very good constructor in the person of Engr.Celestino Condor who was willing to start the work even the funding was not sufficient enough. He used his own money and we pay him as we can. Mr. Fred Ramos was the first donor of one million for the posts and roofing. We asked some friends and benefactors both local and abroad but then it was not yet enough. Then Sr. John was inspired to write to the late Pope John Paul II for donations. The response was immediate without passing through the normal procedures. It arrived on the death anniversary of Mo.Frances Therese. We were able to finish the Chapel and the renovation of the roof of the extern sister’s quarter too. However, the problem does not end there.</p><p>\r\n</p><p style=\"text-align: justify\">After Mother Frances died on April 4, 2002, the community was concerned about the dilapidating condition of the cocolumber and Nipa in the hermitages and the pulverizing condition of the asbestos roof of the community building causing sickness among the sisters. They had prayed and storm heaven for help, for we have no means to repair them.</p><p>\r\n</p><p style=\"text-align: justify\">One day an angel of the Lord came in the person of Mr. Antonio Sy, (brother of Sr.Clare). He suggested writing a letter of appeal to Mr. Victor Consunji for he knew him as a generous benefactor of Mati Carmel. Without hesitation one sister wrote to him. They waited for a while but no answer. The letter got wrong address and came back. Another letter was sent to Mr. Victor Consunji and he responded immediately. He sent two engineers to see the place and later he came and seeing the condition of the sisters, he took pity for he felt extremely warm in the quarter of the sisters and the materials were really in bad shaped. Before leaving he gave a one million check to the community. Mr. Victor Consunji with his parents Mr. and Mrs. David Consunji and the whole family agreed to undergo those big donations. God be praised for he took pity on us not because of our goodness and worthiness but out of his infinite mercy and love. He blesses these people and sent them to us in His time caring for us in His behalf. They gave us not only the beautiful buildings but furnished them with all the necessary things needed even the complete gadgets for the sick and the infirmary units. Everything we received was beyond our expectations and these immense blessings we got before our golden Jubilee are an affirmation of God’s abiding presence with us all these years after so many years of hardships and sufferings to be able to survive from our humble beginnings. Now, He bestows \r\nHis tremendous love and mercy. God alone can repay you for all the gifts you have lavished on us. As we continue to journey beyond this golden year... we keep you all in our hearts, in our prayers and also those people who will come after us. We will remember you for your names cannot be erased in the heart of our loving God.</p>', NULL, 1, '2019-09-21 16:25:01', NULL, NULL, b'0'),
