INSERT INTO `history` (`id`, `branch_id`, `date_of_establishment`, `feast_day`, `titular`, `diocese`, `content`, `media_id`, `created_by`, `dt_created`, `updated_by`, `dt_updated`, `is_deleted`) VALUES
(19, 19, '', '', '', '', '<p style=\"text-align: justify\">At the closing of the Eucharistic and Marian Year, on November 21, 2005, the Carmel of St. Teresa of Jesus marked its 18th Anniversary of Foundation. A debut, they call it. But its history can be traced as early as the sixties -- and it started with a call. It was in the 1960’s when the nuns of Davao Carmel got an invitation for a foundation. It came from their former chaplain, the late Bishop Joseph Regan, MM, DD, of happy memory, a Maryknoll Missionary, who was then recently consecrated first Bishop of Tagum, Davao del Norte -- the first call.</p><p>\r\n</p><p style=\"text-align: justify\">In 1984, Rome divided the Diocese of Tagum. The late Holy Father Pope John Paul II, of venerable memory, appointed Msgr. Patricio H. Alo, DD, who was then Auxiliary Bishop of Davao, as first Bishop of the Diocese of Mati. in November that year, Msgr. Alo asked the Carmelites of Davao to have a foundation in his diocese. A Carmelite Tertiary since his seminary days, the newly installed bishop believed in the efficacy of prayer, hence the need of contemplative nuns -- the second call.</p><p>\r\n</p><p style=\"text-align: justify\">The nuns received the invitation with open minds and hearts. After all Davao Carmel was nearly 40 years old, the number of nuns in the community is steadily increasing - almost reaching the maximum of twenty-one sisters and many good aspirants were knocking at Carmel’s door seeking entrance. These factors contributed to the favorable consideration of the Mati Foundation.</p><p>\r\n</p><p style=\"text-align: justify\">So, before the Ruby Jubilee of Davao Carmel came around (March 10, 1987), the Nuns decided in joyful thanksgiving to the Almighty Father for the bountiful graces and blessings received all these forty years of their existence, to make their first foundation of Mati, Davao Oriental.</p><p>\r\n</p><p style=\"text-align: justify\">The application of foundation was made with the Sacred Congregation for Religious and Secular Institutes and the Generalate of the Order of Discalced Carmelites in Rome.</p><p>\r\n</p><p style=\"text-align: justify\">Its probation was dated May 16,1987, Feast of Saint Simon Stock, to whom Our Lady of Mount Carmel gave the Brown Scapular. Davao Carmel received the happy news of it from the Apostolic Nuncio’s office in Manila by long distance call on June 1, 1987.</p><p>\r\n</p><p style=\"text-align: justify\">As tribute to Our Lady on the Marian Year 1987, the Laying of the Cornerstone of the new monastery was held on August 15, 1987, Feast of the Assumption of the Virgin Mary.</p><p>\r\n</p><p style=\"text-align: justify\">A big gathering of friends, benefactors and religious filled the whole expanse of the bull-dozed area on the hill of Tua-Tua, the land graciously donated by Mr. and Mrs. Senador “Max” Zamora. Bishop Patricio Alo presided the Mass with Rev. Fr. Alan Rieger and Rev. Fr. Apolinario Abing, DCM, as concele-brants. In his homily, Fr. Alan, OCD said that the monastery is God’s gift to Mati.</p><p>\r\n</p><p style=\"text-align: justify\">Three years after that second call, on November 21, 1987 - Feast of Our Lady’s Presentation, ten Carmelite Nuns from Davao Carmel led by Rev. Mother Marie Susan of Jesus, OCD, of happy memory, and Rev. Mother Mary of Sacred Heart, OCD left for the Foundation of Mati Carmel. Their ever reliable and dear Sr. Angeline of the Blessed Sacrament went ahead of them as advanced party.</p><p>\r\n</p><p style=\"text-align: justify\">Prior to their leave-taking, the Nuns destined for Mati had Holy Mass together with their Sister in Davao Carmel. They had His Excellency, the late Msgr. Antonio Mabutas, of happy memory, for main celebrant and homilist. In his homily, he said, “ the Sisters of Mati unite with Mary as She leaves her parents Joachim and Anne for the temple of God...” they sang the Solemn Salve in honor of Our Lady after the Mass. this was followed by a brief repast together, then the “Marys” bade their “Beloved Joachims and Annes” Goodbye.</p><p>\r\n</p><p style=\"text-align: justify\">After this, the caravans of relatives, friends, benefactors and religious accompanying them started their journey to Mati. their first stop was in Tagum Cathedral where the late and dear Rev. Msgr. Joseph Regan, and Rev. Fr. Valle were awaiting with a liturgical welcome.</p><p>\r\n</p><p style=\"text-align: justify\">They made their second stop in Banaybanay, first town of the Diocese of Mati, where a delegation from the Mati Diocese was also waiting to welcome them. Finally they reached San Nicolas de Tolentino in Mati, Davao Oriental. Their Excellencies Archbishop Antonio Mabutas and Bishop Patricio Alo awaited them; the former to hand them over, the latter to officially welcome them.</p><p>\r\n</p><p style=\"text-align: justify\">At 3:30 PM that same day, the Foundation Mass was held with Msgr. Antonio Mabutas as main celebrant at the residence of Mr. and Mrs. Herminigildo Junio who graciously lent their place as temporary housing for the Nuns. He was joined by Bishop Patricio Alo, Rev. Fr. Edito Ba o, DCM, their first chaplain, Rev. Fr. Jose Maria Lopez, OCD and Rev. Fr. Danilo Fuentes, DCM as concelebrants. Henceforth, November 21, 1987 is the Foundation Day of the Carmel of St. Teresa of Jesus.</p><p>\r\n</p><p style=\"text-align: justify\">Their stay in Tindalo was short, yet it was filled with joyful celebrations which proclaimed the mercies of the Lord particularly the grace of His fidelity. To name a few, there was the Ruby Jubilee of Rev. Mother Susan of Jesus, barely three weeks after their arrival in Mati; the Diamond and Silver Jubilee of Sacerdotal Ordination of Bishop Regan and Bishop Alo, respectively; and the Jubilees of the Nuns on their Profession Anniversaries.</p><p>\r\n</p><p style=\"text-align: justify\">In December 1987, Architect Renato Basa presented the architectural design of the new monastery. By the first working day after Christmas 1987, workmen for the construction, headed by Mr. Ben Deligero came in full force. During the period of its construction, Mother Susan and Mother Mary would regularly go up to the hills of TuaTua to supervise and monitor the progress of the edifice. Boy and Susan Zamora, their ever faithful benefactors, generously provided trucks for transport construction materials from Davao City to Mati.</p><p>\r\n</p><p style=\"text-align: justify\">The Nuns of Carmel fondly recall with gratitude all the help which the Friends of Carmel have lovingly extended to them all these years but especially during the early stages of the foundation. To mention a few, they organized projects like “ Dinner and Bingo for a Cause” to raise funds. There were concerts and retreats of Rev. Fr. Sonny Ramirez, OP and the other means in order for the construction to go on.</p><p>\r\n</p><p style=\"text-align: justify\">All these efforts came into fruition as it paved the way for the Nuns’ transfer to their new monastery. On March 28, 1989, Easter Tuesday and Birth Anniversary of St. Teresa of Jesus -- the titular patroness of their Carmel, they left their temporary abode which they have learned to love and move up to Carmel’s Heights.</p><p>\r\n</p><p style=\"text-align: justify\">On July 16, 1989, Solemnity of Our Lady of Mt. Carmel, Archbishop Antonio Mabutas, and Msgr. Patricio Alo officiated the Blessing and Inauguration of the Monastery. There was an open-house for three days from July 14-16, in which the people were allowed to enter the monastery.</p><p>\r\n</p><p style=\"text-align: justify\">The Nuns had the chance to express their gratitude to the people, especially their friends and benefactors who made possible this work of the Lord.</p><p>\r\n</p><p style=\"text-align: justify\">By the time of their transfer one one-third of the monastery was completed and they had to make do with it while the construction was on going. There were no enclosure walls and they patiently waited for God’s providence... and their dire need it came. God sent an instrument, the profoundly cheerful giver, Mr. Victor A. Consunji, a long time friend of Carmel and an immensely generous man whose love of giving is the very essence of his person, a philanthropist who finds true joy in sharing what he has. He shouldered the construction of enclosure walls around the monastery. Handled and supervised by Engr. Arnel Coton and assisted by Engr. Alberto Gahuman, this property was completed by 1995.</p><p>\r\n</p><p style=\"text-align: justify\">Shortly after, God took Himself their dear Foundress, Mother Marie Susan of Jesus on June 17, 1995. Though physically gone, she remained truly a mother of this Carmel she has founded. With St. Joseph’s intercession, another help came from their equally benevolent friends Mr. and Mrs. Emil and Vivian Sison, who offered to finance the building of a portion of the monastery. With structural design by Arch. Cesar Gamalong, this constructed area was blessed on July 13, 1997.</p><p>\r\n</p><p style=\"text-align: justify\">The Lord lavishly showered His gifts one after the other as barely two years have passed and Victor Consunji again in his kindness took charge of constructing another portion of the enclosure of the monastery. Arch. Illuminado Quinto, jr. made the structural design. Engr. Arnel Coton headed the construction of this project which was blessed on December 7, 1999.</p><p>\r\n</p><p style=\"text-align: justify\">Indeed the Lord is extremely gracious. By this time, the entire monastery building as substantially complete, save for the permanent Chapel and Infirmaries. Yet as St. Paul said: “ I am certain that the one who has begun the good work in you will see that it is finished.” God is faithful. The Nuns are confident that graces will come in due time.</p><p>\r\n</p><p style=\"text-align: justify\">The Year 2000 opened with its unique store of gifts. The Great Jubilee saw their Carmel as a Pilgrimage Site -- what a signal grace! There were also visits of Our Blessed Mother -- the statue of the Pilgrim Virgin of Fatima, the relics of their very own Camelite, St. Therese of the Child Jesus, which brought them rich spiritual blessings.</p><p>\r\n</p><p style=\"text-align: justify\">Two priestly ordinations were held in their chapel. First was of Rev. Fr. Shaji Thomas Punnatu, a Vocationist from India on May 14, 2000. This was followed by the ordination on December 8, 2001 of Rev. Fr. Edmundo Escobal -- the first fruits of the Vocationist Mission in the Philippines. Such events befitting the ideals of St. Teresa of Jesus who reformed Carmel where prayers and sacrifices are offered for the Church, for Priests and the salvation of souls.</p><p>\r\n</p><p style=\"text-align: justify\">On December 15, 2001 they were graced by the presence of the Apostolic Nuncio to the Philippines, His Excellency, Most Rev. Antonio Franco, DD, who came to the Diocese of Mati on the occasion of its Foundation Anniversary. He paid a visit to the Nuns, celebrated Mass with them and blessed the five Joyful Mysteries of the “ Regina Decor Carmeli Prayer Garden”.</p><p>\r\n</p><p style=\"text-align: justify\">The New Millenium commenced with renewed hope for the mercies of the Lord. As they made their presence felt in the diocese, Mass-goers flock to Carmel’s heights especially when there are feasts and solemnities. Their little chapel can hardly accommodate them that people would have to stay outside the church.</p><p>\r\n</p><p style=\"text-align: justify\">On such occasions, the longing for a bigger place of worship usually comes to the fore. If only they have means to build a larger one...a permanent monastery chapel.</p><p>\r\n</p><p style=\"text-align: justify\">Yet they trust fully that God is ever faithful and will do great things in His own time. Believing the percept that if a man does his best, God will do the rest, the Nuns, with the ever steadfast support of the Friends of Carmel, continued to initiate fundraising campaigns, this time the “ piggy bank” drive.</p><p>\r\n</p><p style=\"text-align: justify\">“Piggy Banks” were given to walk-in visitors in the monastery, to benefactors and relatives. These were distributed to friends who in turn placed them in strategic counters at department stores, malls, gasoline stations, hospitals, schools, private establishments, government offices, etc. In the spirit of giving, people from different walks of life respond positively. And how kind were the school children who, in their tender age, already had the sense of sharing, finding joy in putting their contribution in the piggy bank.</p><p>\r\n</p><p style=\"text-align: justify\">On the other hand, the Friend of Carmel led by its President, Mrs. Ampy Icasas, with Mrs. Violy Santiago, launched the Special Advance Screening of “The Passion of the Christ” in April 2004. This project was a real success and help greatly. The Nuns remained ever thankful to the Friends of Carmel for this venture and those who benevolently pledged sponsorship.</p><p>\r\n</p><p style=\"text-align: justify\">With this awe-inspiring development, they joyfully hope for the outpouring of more graces; for after their fund drives, the proceeds would not suffice to finance the building of a chapel. It does not matter should it take several years before their dream will be realized; as long as it will come, they can wait. Like the woman in the time of the Prophet Elijah, they have faith that their jar and jug will be constantly filled until “all is finished”. They leave everything in God’s hands.</p><p>\r\n</p><p style=\"text-align: justify\">And how truly God fulfills His promise... for consequently, the ever magnanimous and big-hearted Mr. Victor Consunji once again visited the Nuns bringing the one grand news: he and his family pledging to build the Monastery Church and infirmaries. A splendid news indeed!!!... at last this would bring to completion the construction of the entire monastery. The Nuns raised their sighs of thanksgiving to heaven in praise to God.</p><p>\r\n</p><p style=\"text-align: justify\">The groundbreaking ceremony took place on October 1, 2004, the Feast of St. Therese of the Child Jesus. Famous Arch. Manuel Chiew made the architectural and structural plans of the building while Arch. Susan Castillo was responsible for the structures and artworks of the interiors of the chapel. Engr. Antonio Francisco, Jr. was the man behind the entire construction of the wonderful edifice. He was assisted by Engr. Alberto Gahuman. As the project progressed, Mr. Bert Noma came to assist in the supervision of the workforce as a Foreman. Engr. Teddy Hilado employed his creative skills in carefully designing the lightning effects of the church.</p><p>\r\n</p><p style=\"text-align: justify\">The Laying of the Cornerstone was held on November 21, 2004 on the occasion of Mati Carmel’s 17th Foundation Anniversary. Magr. Patricio H. Alo presided the Mass with Fr. Dan Fauste, \r\nOCD, Fr. Dennis Alingalan, DCM and Fr. Thaddeus Aririele, SDV as concelebrants. Friends and benefactors came to witness this event. Their Sisters in Davao Carmel were in attendance joining them as the choir during the ceremonies.</p><p>\r\n</p><p style=\"text-align: justify\">As the construction progressed, friends and benefactors from the near and far also got involved in helping the nuns in anyway they could. Their dear Sonny and Ampy Icasas generously made available their trucks to bring the construction materials from Davao.</p><p>\r\n</p><p style=\"text-align: justify\">The people of Mati had their share and got involved in their own way: from school children to grey-haired individuals. They gave from what they have to live on. As the saying goes, “ No one is too poor that he has nothing to share”, their aspirations, their desires, their hopes, their encouragement -- their smiles and most of all their fervent prayers to God for its accomplishments are precious support worth more than silver or gold before the throne of the Lord. He will in turn reward them abundantly.</p><p>\r\n</p><p style=\"text-align: justify\">On November 21, 2005, 18th anniversary of their foundation, the Infirmaries, priest’s quarter and the choir were blessed.</p><p>\r\n</p><p style=\"text-align: justify\">And finally, on December 10, 2005 was held the Solemn Blessing and Consecration of the Monastery Church under the patronage of Our Lady of Mt. Carmel and Saint Joseph. Msgr. Patricio Alo, bishop of Mati, was the main celebrant. Joining him were Msgr. Guillermo Afable, bishop of Digos, and a number of priests and religious concelebrants. The Consunji family, headed by Engr. and Mrs. David and Fredesvinda Consunji, graced the occasion with their presence. The Friends of Carmel were in attendance. Benefactors and friends from Mati, Davao and other parts of the country came to witness this grand event in joyful praise and thanksgiving to the Most Holy Trinity.</p><p>\r\n</p><p style=\"text-align: justify\">Eighteen years have come and gone and through these time came an avalanche of blessings. The Carmelite Nuns of Mati marvel in a spirit of deep gratitude at the graciousness of God. Their hearts are overflowing with thanksgiving for the bountiful years that brought them so much grace They wanted to count their blessings one by one but they come as though in torrent. They will be forever indebted to all those who have always been there to support them. They wish to find ways to make some returns for the kindness of these people -- the gems of great price: Mr. Victor Consunji and his family for building such a magnificent dwelling place of the Lord; the ever-faithful Friends of Carmel -- for the unswerving concern and solitude for their needs all these years; all benefactors; sponsors; patrons and the people who have helped in one way or another. But aware of their poverty and unworthiness, they leave the repaying to the ALL-Knowing Father to dispense the graces as fit reward for their acts of charity in this life and in the next.</p><p>\r\n</p><p style=\"text-align: justify\">From the Carmelite Nuns of Carmel of St. Teresa of Jesus, this souvenir is a tribute of gratitude for a plentiful 18 years. The hands of God be all the glory and honor and praise.</p><p>\r\n</p><p style=\"text-align: justify\">The chronicle doesn’t end here. This year marks the beginning of another milestone of their journey in the service to the people of God of this diocese and the whole Church by their dedication to the life of prayer, contemplation, solitude and sacrifice.</p>', NULL, 1, '2019-09-21 16:28:10', NULL, NULL, b'0'),
(20, 20, '', '', '', '', '<p style=\"text-align: justify\"></p><p>\r\n</p><p style=\"text-align: justify\"></p><p>\r\n</p><p style=\"text-align: justify\"></p>', NULL, 1, '2019-09-21 16:28:26', NULL, NULL, b'0');
