INSERT INTO `sub_modules` (`id`, `program_id`, `module_id`, `name`, `description`, `action`, `acceptance_content`, `thank_you_content`, `create_url`, `media_id`, `created_by`, `dt_created`, `updated_by`, `dt_updated`, `is_deleted`) VALUES
(1, 3, 4, 'Confraternity of Our Lady of Mount Carmel', 'A Carmelite brotherhood in pursuit of the mission, and in service of the Lord', NULL, '<p>Fees:</p>\r\n<p>Application Fee</p>                                        <p>Scapular</p>                                        <p>Confraternity Manual</p>                                        <p>Certificate of Confraternity</p>\r\n<p>200 php</p>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>', '<p>Thank you for joining the Confraternity. Your application is subject for review, upon approval please settle the application fee.</p>\r\n<p>Please visit Mount Carmel Shrine head office to receive your Scapular, Confraternity Manual and Certificate of Confraternity.</p>\r\n<p>We will be reaching you through your provided contact details.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/confraternities/create', NULL, 1, '2019-06-19 18:29:13', 1, '2019-09-25 14:32:27', b'0'),
(2, 3, 5, 'Prayer Request', 'Send your prayer request with the help of our Carmelite priests in offering your petitions', NULL, '<p>Prayer Request is free of charge.</p>', '<p>Thank you for sending your prayer request. We will be offering your requests and petitions.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/prayer_requests/create', NULL, 1, '2019-06-19 18:30:35', 1, '2019-07-25 14:41:09', b'0'),
(3, 3, 5, 'Mass Request', 'Send your mass request with the help of our Carmelite priests in offering your intentions', NULL, '<p>After submission, you may donate any amount as an offering for your requested mass in your mailbox.</p>', '<p>Thank you for for sending your mass request. We will be offering your prayer intentions after completing the process in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/mass_requests/create', NULL, 1, '2019-06-19 18:31:05', 1, '2019-07-25 14:44:43', b'0'),
(4, 3, 5, 'Liturgical Service', NULL, NULL, '<p>Liturgical Service for blessing of houses, businesses and cars, as well as annointing of the sick or for other purposes.</p>\r\n</br>\r\n<p>Parishioner may give the officiating priest a donation after the service.</p>\r\n</br>\r\n<p>Exclusive for parishioners of Our Lady of Mount Carmel.</p>', '<p>Thank you for requesting a liturgical service. Choose your officiating priest in your mailbox and wait for an approval.</p>\r\n<p>Upon approval, please pick up the officiating priest 30 minutes before the time of event or earlier.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/liturgical/create', NULL, 1, '2019-06-19 18:32:13', 1, '2019-10-12 22:47:10', b'0'),
(5, 3, 5, 'Certification', NULL, NULL, '<p>We furnish baptismal certificate and confirmation certificate for parishioners.</p></br>\r\n<p>For Purposes such as for Personal file, School, Confirmation, First Communion, Legal documents, SSS requirement, Travel documents, Issuance of Birth Certificate and Marriage.</p></br>\r\n<p>Fees:</p></br>\r\n<p>Printing Service</p>\r\n<p>  50 php</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>', '<p>Thank you for your application for Certification. Your application is subject for review, upon approval please settle the application fee.</p>\r\n<p>Please visit Mount Carmel Shrine Head Office to receive your Certificate.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/certification/create', NULL, 1, '2019-06-19 18:32:40', 1, '2019-10-12 22:48:17', b'0'),
(6, 3, 6, 'Individual Baptism', NULL, NULL, '<p>Schedule:</p></br>\r\n<p>Tuesday - Saturdays</p>\r\n<p>09:00 AM</p>\r\n<p>10:00 AM</p>\r\n<p>11:00 AM</p>\r\n<p>03:00 PM</p>\r\n<p>04:00 PM</p></br>\r\n<p>Sundays</p>\r\n<p>09:00 AM</p>\r\n<p>10:00 AM</p>\r\n<p>11:00 AM</p></br>\r\n<p>Additional Requirements:</p></br>\r\n<p>Child\'s Birth Certificate</p>\r\n<p>Parent\'s Marriage Contract</p>\r\n<p>Permission Letter (if needed)</p></br>\r\n<p>Fees:</p></br>\r\n<p>Venue</p>\r\n<p>  1,000 php</p></br>\r\n<p>Stipend for the Priest</p>\r\n<p>  1,000 php</p></br>\r\n<p>For every Sponsor</p>\r\n<p>  100 php</p></br>\r\n<p>Panyal, Certificate, Candle for the Parents, 2 Candles in glass for the Sponsors (candles for additional sponsors are not included)</p>\r\n<p>  300 php</p></br>\r\n<p>Reservation Fee (deductible)</p>\r\n<p>  2,000 php</p></br>\r\n<p>Baptism will be held in Pilgrim Chapel, St. Joseph Bldg.</p>\r\n<p>For non-parishioners, permission letter from your parish must be submitted in Mt. Carmel office.</p></br>\r\n<p>All sponsors must be catholic and 18 years old or above.</p></br>\r\n<p>Requirements and fees must be accomplished a week before the baptism.</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>\r\n<p>Be punctual, only an hour is alloted for the whole baptism.</p>', '<p>Thank you for your application for individual baptism.</p>\r\n<p>Individual Baptism is subject for review and approval by the office and the chosen officiating priest.</p>\r\n<p>Finish transaction by rendering all necessary requirements in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/individual/create', NULL, 1, '2019-06-19 18:33:27', 1, '2019-10-12 22:50:43', b'0'),
(7, 3, 6, 'Community Baptism', NULL, NULL, '<p>Schedule:</p></br>\r\n<p>Sundays</p>\r\n<p>02:00 PM</p><br></br>\r\n<p>Additional Requirements:</p></br>\r\n<p>Child\'s Birth Certificate</p>\r\n<p>Parent\'s Marriage Contract</p>\r\n<p>Permission Letter (if needed)</p></br>\r\n<p>Fees:</p></br>\r\n<p>For every Sponsor</p><br>\r\n<p>  100 php</p><br></br>\r\n<p>Registration, Panyal, Certificate, Candle for the Parents, 2 Candles in glass for the Sponsors (candles for additional sponsors are not included)</p>\r\n<p>  400 php</p><br></br>\r\n<p>For non-parishioners, permission letter from your parish must be submitted in Mt. Carmel office.</p></br>\r\n<p>All sponsors must be catholic and 18 years old or above.</p></br>\r\n<p>Requirements and fees must be accomplished a week before the baptism.</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>\r\n<p>Be punctual, only an hour is alloted for the whole baptism.</p>', '<p>Thank you for your application for Community baptism.</p>\r\n<p>Community Baptism is subject for review and approval by the office.</p>\r\n<p>Finish transaction by rendering all necessary requirements in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/community/create', NULL, 1, '2019-06-19 18:33:49', 1, '2019-10-12 22:53:22', b'0'),
(8, 3, 6, 'Adult Baptism', NULL, NULL, '<p>Schedule:</p></br>\r\n<p>Tuesday - Saturdays</p>\r\n<p>09:00 AM</p>\r\n<p>10:00 AM</p>\r\n<p>11:00 AM</p>\r\n<p>03:00 PM</p>\r\n<p>04:00 PM</p></br>\r\n<p>Sundays</p>\r\n<p>10:00 AM</p>\r\n<p>11:00 AM</p></br>\r\n<P>Additional Requirements:</P></br>\r\n<p>Adult\'s Birth Certificate</p>\r\n<p>4 Session Catechesis</p>\r\n<p>Parent Catechesis</p>\r\n<p>Certification of No Records (from 3 parishes from the Vicariate of Holy Family)</p></br>\r\n<p>Fees:</p></br>\r\n<p>Venue</p>\r\n<p>  1,000 php</p></br>\r\n<p>Stipend for the Priest</p>\r\n<p>  1,000 php</p></br>\r\n<p>For every Sponsor</p>\r\n<p>  100 php</p></br>\r\n<p>Panyal, Certificate, Candle for the Parents</p>\r\n<p>  150 php</p></br>\r\n<p>Candle for every Sponsor</p>\r\n<p>  10 php</p></br>\r\n<p>Upon submission, you may contact Catechetical Ministry office to schedule your catethesis.</p></br>\r\n<p>Call 727-94-32 local 411</p>\r\n<p>Tuesdays to Saturdays</p>\r\n<p>9am-5pm</p></br>\r\n<p>All sponsors must be catholic and 18 years old or above.</p></br>\r\n<p>Requirements and fees must be accomplished a week before the baptism.</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p></br>\r\n<p>Be punctual, only an hour is alloted for the whole baptism.</p>', '<p>Thank you for your application for Adult Baptism.</p>\r\n<p>Adult Baptism is subject for review and approval by the office.</p>\r\n<p>Finish transaction by rendering all necessary requirements including attendance for catechesis in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/adult/create', NULL, 1, '2019-06-19 18:34:27', 1, '2019-10-12 23:18:16', b'0'),
(9, 3, 7, 'First Communion', NULL, NULL, '<p>Applicant may only have 1 or 2 sponsors during first communion.</p></br>\r\n<p>Fees:</p></br>\r\n<p>Application Fee</p>\r\n<p>  500 php</p></br>\r\n<p>Upon submission, you may contact Catechetical Ministry office to schedule your catechesis.</p></br>\r\n<p>Call 727-94-32 local 411</p>\r\n<p>Tuesday to Saturdays</p>\r\n<p>9am-5pm</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>', '<p>Thank you for your application for First Communion.</p>\r\n<p>First Communion is subject for review and approval by the office.</p>\r\n<p>Finish transaction by rendering all necessary requirements including attendance for catechesis in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/first_communion/create', NULL, 1, '2019-06-19 18:35:00', 1, '2019-10-12 23:21:57', b'0'),
(10, 3, 7, 'Communion of the Sick', NULL, NULL, '<p>Preferred time of visit will only serve as guide and may not always be accurate.</p></br>\r\n<p>Communion of the Sick is free of charge</p></br>\r\n<p>Exclusive for parishioners of Our Lady of Mount Carmel</p>', '<p>Thank you for requesting a communion for the sick. We will review your request, please wait for the approval of the office and the Extraordinary Ministers of the Holy Communion.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/communion_of_the_sick/create', NULL, 1, '2019-06-19 18:35:17', 1, '2019-10-12 23:24:00', b'0'),
(11, 3, 8, 'Confirmation', NULL, NULL, '<p>Applicant may only have 1 or 2 sponsors during confirmation.</p></br>\r\n<p>Fees:</p></br>\r\n<p>Application Fee</p>\r\n<p>  500 php</p></br>\r\n<p>Upon submission, you may contact Catechetical Ministry office to schedule your catechesis.</p></br>\r\n<p>Call 727-94-32 local 411</p>\r\n<p>Tuesday to Saturdays</p>\r\n<p>9am-5pm</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>', '<p>Thank you for your application for Confirmation.</p>\r\n<p>Confirmation is subject for review and approval by the office.</p>\r\n<p>Finish transaction by rendering all necessary requirements including attendance for catechesis in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/confirmation/create', NULL, 1, '2019-06-19 18:36:00', 1, '2019-10-12 23:25:00', b'0'),
(12, 3, 9, 'Marriage', NULL, NULL, '<p>Wedding Rules and Regulations Agreement</p><br>\r\n    <p>Version 1</p><br>\r\n    <p>1. Reservation Fee and Full Payment</p><br>\r\n    <p>a. Wedding should be arranged and scheduled at least 6 months before the wedding date.</p>\r\n    <p>b. Reserved date is non-movable and non-transferrable.</p>\r\n    <p>c. Reservation fee of 10,000 php will be accepted upon agreement of contract and National Shrine of Our Lady of Mount Carmel Rules and Regulations. Reservation fee is non-refundable but deductible on remaining balance.</p>\r\n    <p>d. All fees should be settled 2 months before the wedding date.</p><br>\r\n    <p>Wedding package includes use of the church, officiating priest, flowers with tulle, wedding candles or candles for secondary sponsors, wedding usherette, wedding commentator, altar server, red carpet, use of electricity for videos, pre-cana seminar and air conditioned holding area for the bride and choir.</p><br>\r\n    <p>Wedding package rates:</p><br>\r\n    <p>January to November rate</p>\r\n    <p>    29,000 php</p><br>\r\n    <p>December rate</p>\r\n    <p>    34,000  php</p><br>\r\n    <p>2. Wedding Requirements</p><br>\r\n    <p>a. All requirements must be completed or accomplished at least 1 month before the wedding date exempting bride and groom under special cases which requires a permit from the Chancery Office of the Diocese of Cubao.</p><br>\r\n    <p>Wedding cases the need to secure a permit:</p><br>\r\n    <p>i. Mixed marriage (marriage between a Catholic and a non-Catholic or marriage between a Filipino or a foreigner)</p><br>\r\n    <p>ii. Overseas Filipino working or living abroad for more than 2 years</p><br>\r\n    <p>iii. With previous marriage (civilly or in the Roman Catholic church)</p><br>\r\n    <p>b. We reserve the right to cancel a wedding if the requirements were not completed.</p><br>\r\n    <p>c. Authorized representatives designated by the bride and groom are duty-bound to comply with the National Shrine of Our Lady of Mount Carmel Rules and Regulations Agreement and will be held responsible for the cancellation of the event for failure to submit all the needed requirements.</p><br>\r\n    <p>d. National Shrine of Our Lady of Mount Carmel will not be responsible for any correction, fines and penalties that may be required on the marriage certificate already filed with the Quezon City Hall, Civil Registry after its entries were verified by the couple. Likewise, the Shrine is not liable if the couple fail to check their marriage contract as required.</p><br>\r\n    <p>3. Cancellation</p><br>\r\n    <p>a. In case of cancellation, a written advice must be submitted, otherwise the couple will have to pay the balance due.</p><br>\r\n    <p>b. Reservation fee, full-payment, and additional fees made will be forfeited.</p><br>\r\n    <p>c. Unclaimed documents will be disposed by the National Shrine of Our Lady of Mount Carmel within 2 months from the day of notice or from the wedding date.</p><br>\r\n    <p>4. Punctuality</p><br>\r\n    <p>a. The bride and groom, and the whole entourage including the soloist, singers and organist must be at the church premises 30 minutes before their wedding schedule.</p><br>\r\n    <p>b. The allotted time for the wedding ceremony is 1 hour and 30 minutes only. Wedding ceremony are as follows, 15 minutes for the entrance procession of the wedding entourage; 45 minutes for the wedding liturgy; 15 minutes for pictorial, 15 minutes for the recessional of the wedding entourage. The wedding entourage should be exiting 15 minutes before the end of their time slot.</p><br>\r\n    <p>c. If the bride, groom or the members of the entourage are late for 15 minutes, there will be no Prayers of the Faithful and Offertory Procession; if they are late for 30 minutes, there will be no Homily, Prayers of the Faithful and Offertory Procession; if they are late for 45 minutes, only the Wedding Rite outside the Mass will be celebrated.</p><br>\r\n    <p>5. Wedding Entourage</p><br>\r\n    <p>a. Bearers and flower girls should be 5 years old and above since they will not need the assistance of parents or guardian when marching down the aisle, which is usually the reason behind the delay of the ceremony.</p><br>\r\n    <p>b. Only 5 pairs of principal sponsors are normally allowed. An additional fee of 500 php per person will be charged in excess of the 5 pairs of sponsors.</p><br>\r\n    <p>c. The bride and groom must assign persons for the First and Second Reading, Responsorial Psalm and Prayers of the Faithful. Commentator will be provided by the church.</p><br>\r\n    <p>6. Officiating Priest</p><br>\r\n    <p>a. The bride and groom should inform the parish office 2 months before their wedding if they have their own officiating priest. If no advice was given, the invited priest will only be allowed to concelebrate with the assigned priest.</p><br>\r\n    <p>b. For own priest, a photocopy of the priest Celebret ID, Certificate of Registration of Authority to Solemnize Marriage (CRASM) and appointment or endorsement letter from the Bishop is required.</p><br>\r\n    <p>c. The Rector/Parish Priest has the right to approve or disapprove permission of the invited priest presider.</p><br>\r\n    <p>d. In case of mixed marriages, the Shrine will not allow any form of rite, ceremony, or speeches to be conducted by other sects or religions.</p><br>\r\n    <p>7. Solemnity and Wedding Dress Etiquette</p><br>\r\n    <p>a. To preserve the solemnity of the wedding ceremony, all electronic gadgets are requested to be turned off or set to silent mode. Bride and groom should advice their respective entourages to refrain from unnecessary conversations and movements.</p><br>\r\n    <p>b. The attire of the entire marriage entourage should be proper for church decorum. Provocative dresses like strapless, backless, spaghetti strap, bare midriff and off-the-shoulder dresses must be covered by a shawl jacket. We discourage above-the-knee length or miniskirt dresses.</p><br>\r\n    <p>c. The National Shrine of Our Lady of Mount Carmel has the right to refuse any member of the entourage who are not properly dressed to join the entrance entourage.</p><br>\r\n    <p>8. Offertory</p><br>\r\n    <p>a. Recommended list of items to be offered during the wedding are basket of fruits, mass wine and pack of hosts only.</p><br>\r\n    <p>b. The bride and groom should assign two persons for the cruets and ciborium which will be provided by the shrine.</p><br>\r\n    <p>c. Offertory procession may be cancelled if time constraints to give priority to the more essential parts of the mass.</p><br>\r\n    <p>9. Church Decoration</p><br>\r\n    <p>a. A simple yet elegant flower decoration in the aisle complete with tulle shall be provided by the shrine. All flower arrangement will be handled by the shrine’s in-house florist.</p><br>\r\n    <p>b. For an additional floral arrangement, the bride and groom should submit a design arrangement for approval of the Rector/Parish Priest. Arrangement shall be done accordingly by the shrine’s in-house florist.</p><br>\r\n    <p>c. During Lent, no flower decoration is allowed in the altar. The bride and groom are to be reminded that wedding events should respect the special nature of this liturgical season; they should refrain from much pomp or display.</p><br>\r\n    <p>d. There will be no deduction in the wedding package rate for the flower arrangement if the bride and groom booked their wedding on Lenten season.</p><br>\r\n    <p>10. Wedding Music</p><br>\r\n    <p>a. Music for the whole ceremony is included in the package.</p><br>\r\n    <p>b. During mass, singing may be done only during entrance, offertory, our Father, communion, recessional and photo sessions.</p><br>\r\n    <p>c. The invited singer or musician should only render songs and music approved by the Rector/Parish Priest.</p><br>\r\n    <p>11. Photographers and Videographers</p><br>\r\n    <p>a. The bride and groom must properly endorse the photographers and videographers that will cover the whole wedding ceremony. The 2 photographers and 2 video personnel must be advised that they are required to attend the orientation seminar before their wedding coverage.</p><br>\r\n    <p>b. Photographers and videographers not following the shrine’s instructions will be blacklisted.</p><br>\r\n    <p>c. Guests of the couples who likewise want to take pictures or videos are allowed but they must remain in their seats.</p><br>\r\n    <p>12. Church Assistance</p><br>\r\n    <p>a. The shrine coordinator shall assist during the wedding for further instructions for the entourage.</p><br>\r\n    <p>b. The bride and groom may assign their wedding coordinators provided that they were properly endorsed and they have attended the shrine’s orientation for coordinators before the wedding.</p><br>\r\n    <p>c. Wedding coordinators not following the shrine’s rules and regulations will be blacklisted.</p><br>\r\n    <p>13. Wedding Missalette</p><br>\r\n    <p>a. The bride and groom my request a standard copy of wedding missalette in the parish office. Digital file or soft copy may be sent through email.</p><br>\r\n    <p>b. No alterations or any addition to the approved liturgy should be made. Personal vows are not allowed.</p><br>\r\n    <p>c. Draft of printed copy of the bride and groom’s wedding missalette must be submitted to the office for checking before making the final copies. Only checked and approved missalettes will be allowed for distribution during the wedding.</p><br>\r\n    <p>14. Respect and Solemnity of the Holy Grounds</p><br>\r\n    <p>a. Pets are not allowed to join the wedding procession.</p><br>\r\n    <p>b. Cleanliness must be strictly observed inside and outside the shrine. Releasing of doves may be done outside the shrine’s doors.</p><br>\r\n    <p>c. Only flower petals are allowed as extended greetings; permitted to be showered outside the shrine’s main entrance. Other extended greetings like party poppers, confetti and rice throwing are not permitted.</p><br>\r\n    <p>d. Fogging and bubbles effect are not allowed inside and outside the shrine.</p><br>\r\n    <p>e. Closed doors are not allowed.</p><br>\r\n    <p>15. General Provision</p><br>\r\n    <p>a. Any damage incurred during the wedding by the wedding entourage or guests, the reasonable cost shall be accounted for by the bride and groom.</p><br>\r\n    <p>b. We have read and signify our agreement on the above terms and conditions of the National Shrine of Our Lady of Mount Carmel Rules and Regulations concerning wedding events and that the National Shrine of Our Lady of Mount Carmel and its personnel will not be held liable to any damages as a result of the enforcement of the said rules and regulations.</p><br>', '<p>Thank you for your application for marriage.</p>\r\n<p>Marriage is subject for review and approval by the office and the chosen officiating priest.</p>\r\n<p>Finish transaction by rendering all necessary requirements in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/marriage/create', NULL, 1, '2019-06-19 18:36:19', 1, '2019-10-12 23:27:04', b'0'),
(13, 3, 10, 'Funeral Service', NULL, NULL, '<p>Funeral Service for blessing or conducting mass during the funeral.</p></br>\r\n<p>Parishioner may give the officiating priest a donation after the service.</p></br>\r\n<p>Exclusive for funerals conducted inside Our Lady of Mount Carmel premises.</p>', '<p>Thank you for requesting a funeral service. Choose your officiating priest in your mailbox and wait for an approval.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/funeral_service/create', NULL, 1, '2019-06-19 18:36:56', 1, '2019-10-12 23:27:55', b'0'),
(14, 3, 10, 'Funeral Chapel', NULL, NULL, '<p>Terms and Conditions for the Use of the Chapel</p></br>\r\n<p>1. Person using the Mount Carmel Chapel (hereinafter referred to as the User) shall reimburse the OCD Community any and all expenses to be incurred in the use thereof. Such expenses are inclusive of but not limited to the following:</p></br>\r\n<p>a.) Use of the hall its own family room and comfort room</p>\r\n<p>b.) Air-conditioners</p>\r\n<p>c.) Refrigerator</p>\r\n<p>d.) Water dispenser</p>\r\n<p>e.) Microwave oven</p>\r\n<p>f.) Furniture</p>\r\n<p>g.) Security</p>\r\n<p>h.) Maintenance</p></br>\r\n<p>User agrees to deposit an amount equivalent to at least one day of their projected stay in the chapel. The balance thereof shall be due and payable by the user a day before the Funeral Mass of the deceased. In case of cancellation of the use of chapel, the said deposit is not refundable.</p></br>\r\n<p>2. Overnight vigil or wakes, except for the first and last night is discouraged. We encourage the family of the deceased to rest, for which reason; the room shall be closed at 1:00AM and re-opened at 7:00AM. The air-conditioners shall be turned off from 1:00AM to 7:00AM. If, for unavoidable circumstances, the room is required to remain open, the cost for the use of the air-conditioner shall be reimbursed at the separate rate of FIVE HUNDRED PESOS (500.00 Php) per hour.</p></br>\r\n<p>3. While security and maintenance are provided, additional security may be provided for the service of the user. The cost thereof shall be reimbursed at the separate rate of FOUR HUNDRED PESOS (400.00 Php) per 8-hour shift.</p></br>\r\n<p>4. The entire hall is strictly a NON-SMOKING AREA. Those who wish to smoke can only do so at the Crucified Christ Courtyard which is located outside the hall.</p></br>\r\n<p>5. GAMBLING of any nature, LIQUOR of any kind, PARKING IN COURTYARD is strictly prohibited.</p></br>\r\n<p>6. No cooking shall be allowed in the rooms. However, heating with the microwave oven is allowed. In case a caterer shall be employed by the family of the deceased to provide food in the premises, the office shall be informed prior to mobilization by the caterer.</p></br>\r\n<p>7. While food and drinks are allowed to be brought in and consumed in the hall, the user is responsible for keeping the premises clean.</p></br>\r\n<p>8. The number of flower arrangement inside the hall should be limited to maintain the desired coolness of the installed air-conditioners. Excess flower arrangements may be placed in the Crucified Christ Courtyard or in the hallway. We encourage the bereaved family members to advise their relatives and friends to the use of Mass Cards or contribution to their favorite charity as a means of expressing their love.</p></br>\r\n<p>9. Should the user schedule masses during the wake, said schedule must first be coordinated with the office. For this purpose, an altar table and mass kit is available for use. Priest of the parish, however, are available subject to their availability.</p></br>\r\n<p>10. The funeral mass may be celebrated at the hall anytime. Should the user desire to celebrate the funeral mass at the main altar of the church, they should make arrangements with the parish office beforehand, to ensure that the proposed schedule does not conflict with any other church activity. If the funeral mass is celebrated in the church, we encourage only two flower arrangements be placed near the casket so as not block the view of the priest and the congregation.</p></br>\r\n<p>11. In case of power failure, the office shall provide to power the lights, fans and some outlets, but not the air-conditioner.</p></br>\r\n<p>12. The water from the faucets in the facility has not been tested for human consumption. Drinking water in 5-Gallon bottles is available in the office for the use of the water dispenser at a reasonable price.</p></br>\r\n<p>13. Should there result in any damage to property within the hall, the cost thereof, or reasonable replacement cost shall be for the account of the user.</p></br>\r\n<p>14. The user shall hold the office free from any liability whatsoever for the use of the hall.</p></br>\r\n<p>15. Lighting of candles during wake is strictly prohibited except when having masses.</p></br>\r\n<p>There are three available chapels for conducting funeral rites and services.</p></br>\r\n<p>Chapels:</p></br>\r\n<p>Mt. Carmel Chapel</p></br>\r\n<p>  150 sitting capacity</p>\r\n<p>  15,000 php/day</p>\r\n<p>  650 php/excess hour</p></br>\r\n<p>St. Joseph Chapel</p></br>\r\n<p>  40 sitting capacity</p>\r\n<p>  8,000 php/day</p>\r\n<p>  350 php/excess hour</p></br>\r\n<p>Holy Family Chapel</p></br>\r\n<p>  40 sitting capacity</p>\r\n<p>  8,000 php/day</p>\r\n<p>  350 php/excess hour</p></br>\r\n<p>Chapel Amenities:</p></br>\r\n<p>Daily Mass</p>\r\n<p>Fully air-conditioned</p>\r\n<p>Refrigerator</p>\r\n<p>Hot and cold water dispenser</p>\r\n<p>Microwave oven</p>\r\n<p>Kitchen sink</p>\r\n<p>Single bed</p>\r\n<p>Family room</p>\r\n<p>Restroom</p>\r\n<p>24 hour security services</p>\r\n<p>Ample parking space</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>', '<p>Thank you for requesting a funeral chapel. Schedule your rental and settle your rental fee in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/funeral_chapel/create', NULL, 1, '2019-06-19 18:37:23', 1, '2019-10-12 23:31:17', b'0'),
(15, 3, 10, 'Crypt Lobby - Mass for the Dead', NULL, NULL, '<p>Crypt Lobby is available for conducting mass for the dead.</p></br>\r\n<p>Fees:</p></br>\r\n<p>Crypt Lobby</p><br>\r\n<p>  20 sitting capacity</p>\r\n<p>  500 php/hour</p></br>\r\n<p>You may settle your bill using your debit card, credit card or cash.</p>', '<p>Thank you for requesting a mass for the dead at the crypt lobby. Schedule your rental and settle your rental fee in your mailbox</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/crypt_lobby/create', NULL, 1, '2019-06-19 18:37:42', 1, '2019-10-12 23:34:03', b'0'),
(16, 3, 10, 'November Mass for the Dead', NULL, NULL, '<p>Mass for the Dead will be offered every 06:00 AM of November.</p></br>\r\n<p>After submission, you may donate any amount as an offering for your requested mass in your mailbox.</p>', '<p>Thank you for  sending your mass request. We will be offering your masses for the dead on November after completing the process in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/november_mass/create', NULL, 1, '2019-06-19 18:37:57', 1, '2019-10-12 23:34:38', b'0'),
(17, 3, 11, 'Father Mark Horan Hall - Venue', NULL, NULL, '<p>Father Mark Horan Hall Service Agreement</p></br>\r\n<p>Version 1</p></br>\r\n<p>1. Event and Duration</p></br>\r\n<p>a. Father Mark Horan Hall is available for wedding reception, baptismal, birthday celebration and anniversary celebration.</p>\r\n<p>b. Client are given a maximum of 3 hours for the use of the Father Mark Horan Hall. Set up time is only 2 hours before the actual time of event.</p></br>\r\n<p>2. Reservation Fee and Full Payment</p></br>\r\n<p>a. Reservation fee of 50% will be accepted upon agreement of terms and conditions. Reservation fee is non-refundable but deductible on remaining balance.</p>\r\n<p>b. All fees should be settled 2 weeks before the event. Booking 1 week prior to the event, payment must be in full.</p></br>\r\n<p>Service package rates:</p></br>\r\n<p>Whole area package 1</p>\r\n<p>  300 tiffany chairs</p>\r\n<p>  30 tables</p>\r\n<p>  30,000 php</p>\r\n<p>  2,000 php/excess hour</p></br>\r\n<p>Whole area package 2</p></br>\r\n<p>  300 monoblock chairs</p>\r\n<p>  30 tables</p>\r\n<p>  27,500 php</p>\r\n<p>  2,000 php/excess hour</p></br>\r\n<p>Half area package 1</p></br>\r\n<p>  120 tiffany chairs</p>\r\n<p>  12 tables</p>\r\n<p>  23,000 php</p>\r\n<p>  1,000 php/excess hour</p></br>\r\n<p>Half area package 2</p></br>\r\n<p>  120 monoblock chairs</p>\r\n<p>  12 tables</p>\r\n<p>  20,000 php</p>\r\n<p>  1,000 php/excess hour</p></br>\r\n<p>Quarter area package 1</p></br>\r\n<p>  80 tiffany chairs</p>\r\n<p>  8 tables</p>\r\n<p>  15,000 php</p>\r\n<p>  500 php/excess hour</p></br>\r\n<p>Quarter area package 2</p></br>\r\n<p>  80 monoblock chairs</p>\r\n<p>  8 tables</p>\r\n<p>  10,000 php</p>\r\n<p>  500 php/excess hour</p></br>\r\n<p>All areas include the use of air conditioner, built-in sound system, ample parking space, clean toilet, LCD projector, and electricity for photo booth and maximum of 2 food carts.</p></br>\r\n<p>3. Reserved Date</p></br>\r\n<p>a. Reserved date is non-movable</p>\r\n<p>b. In the event wherein the client requests for a transfer of his/her reservation to another date or transfer his/her reservation to a member of his/her family, the client is requested to submit a letter of intent addressed to the superior of the shrine. If the superior allows the transfer, the client will be charged for an additional 50% of the down payment made on his/her previous reservation as penalty.</p></br>\r\n<p>5. Safety and Security</p></br>\r\n<p>a. The client has the full responsibility toward the safety and security of their guests.</p>\r\n<p>b. The client and their guests are reminded to secure their valuables at all times. Management shall be free from any liability arising from any unforeseen events such as theft, robbery, accident, and any natural or man-made calamities that may cause harm to the client, their guests and their belongings before, during and after their function at the Father Mark Horan Hall.</p></br>\r\n<p>6. Damages</p></br>\r\n<p>a. Should there result in any damage to property incurred by the client or guests within the Father Mark Horan Hall, the cost thereof, or reasonable replacement cost shall be accounted for by the client.</p></br>\r\n<p>7. Power Outage</p></br>\r\n<p>a. In the event of power outage or brownout, there will be a stand-by generator which will provide power for lights, fans and some outlets but not the air conditioning units.</p><p></p>\r\n<p>There will be no refund if the Father Mark Horan Hall was booked with air conditioning.</p></br>\r\n<p>8. Catering Service</p></br>\r\n<p>a. The client may bring in catering service provider of their choice, all accredited and unaccredited catering service providers must abide with the regulations and policies regarding the use of Father Mark Horan Hall.</p>\r\n<p>b. The management shall be free from any legal suit and liability with regards to the services rendered by the catering service provider, including issues such as food poisoning and sanitation.</p></br>\r\n<p>9. Ground Rules</p></br>\r\n<p>a. Doves and butterflies are not allowed inside the Father Mark Horan Hall.</p>\r\n<p>b. Use of kerosene or gas torch is strictly prohibited inside Father Mark Horan Hall.</p>\r\n<p>c. Swag and drape clothing are strictly prohibited.</p>\r\n<p>d. Party poppers are not allowed inside the Father Mark Horan Hall.</p>\r\n<p>e. Clients are allowed to bring a maximum of 6 cases of liquor such as Pale Pilsen, Red Horse, San Mig Light,or the same kind only.</p></br>\r\n<p>10. General Provision</p></br>\r\n<p>a. The client shall hold the management free from any liability whatsoever for the use of the Father Mark Horan Hall.</p>\r\n<p>b. The client\'s event coordinator must abide with all the rules and regulations. They shall inform the management for any requests 2 weeks prior to the event. Any such requests may be declined without necessity of explanation.</p>', '<p>Thank you for requesting a venue. Scheudule your rental and settle your rental fee in your mailbox.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/events_fmhh_venue/create', NULL, 1, '2019-06-19 18:39:03', 1, '2019-10-12 23:38:36', b'0'),
(18, 3, 4, 'Application Form', '', NULL, '<p>Free of Charge</p>', '<p>Thank you for joining. Your application is subject for review, upon approval.</p>\r\n<p>We will be reaching you through your provided contact details.</p>\r\n<p>You may view the status of your request in your mailbox.</p>', 'https://api.mountcarmel.ph/application_forms/create', NULL, 1, '2019-10-03 19:34:56', NULL, NULL, b'0'),
